import{_ as p}from"./_plugin-vue_export-helper.cdc0426e.js";import{o as n,c as t,a as e,b as a,d as o,e as s,r as h}from"./app.cfc5ed85.js";const d={},c=s(`<blockquote><p>\u4E0D\u77E5\u4E0D\u89C9\u5165\u804C\u65B0\u516C\u53F8\u5FEB\u4E00\u4E2A\u6708\u4E86\uFF0C\u7A81\u7136\u5FC3\u8840\u6765\u6F6E\u60F3\u8DDF\u5927\u5BB6\u5520\u5520\uFF0C\u5728\u65B0\u516C\u53F8\u4E0A\u73ED\u7684\u611F\u53D7\u3002\u6709\u597D\u6709\u574F\uFF0C\u559C\u5FE7\u53C2\u534A\u5427\u3002</p></blockquote><h2 id="\u5DE5\u4F5C\u73AF\u5883" tabindex="-1"><a class="header-anchor" href="#\u5DE5\u4F5C\u73AF\u5883" aria-hidden="true">#</a> \u5DE5\u4F5C\u73AF\u5883</h2><p>\u6211\u65B0\u5165\u804C\u7684\u516C\u53F8\u662F\u54C8\u5C14\u6EE8\u7684\u4E00\u5BB6\u56FD\u4F01\u4E0B\u7684\u4E8C\u7EA7\u5B50\u516C\u53F8\uFF0C\u65B0\u6210\u7ACB\u7684\u7814\u53D1\u516C\u53F8\uFF0C\u76EE\u524D\u8FD8\u5904\u4E8E\u84EC\u52C3\u53D1\u5C55\u7684\u9636\u6BB5\uFF0C\u4E1A\u52A1\u6C34\u51C6\u4E5F\u7B97\u7684\u4E0A\u662F\u4E0D\u9519\u4E86\u3002</p><h3 id="\u4EBA" tabindex="-1"><a class="header-anchor" href="#\u4EBA" aria-hidden="true">#</a> \u4EBA</h3><p>\u76EE\u524D\u4EBA\u6570100\u591A\u4E2A\uFF0C\u4F46\u662F\u5374\u4E94\u810F\u4FF1\u5168\u3002\u5355\u8BF4\u7814\u53D1\u90E8\u95E8\uFF0C\u4ECE\u4EA7\u54C1\uFF0CUI\uFF0C\u7814\u53D1\uFF0C\u6D4B\u8BD5\uFF0C\u8FD0\u7EF4\uFF0C\u751A\u81F3\u8FD0\u8425\u4EBA\u5458\u90FD\u5F88\u5B8C\u5584\uFF0C\u4EBA\u5458\u53EA\u9700\u8981\u6839\u636E\u81EA\u5DF1\u7684\u804C\u8D23\u53BB\u8D1F\u8D23\u81EA\u5DF1\u7684\u4E8B\u60C5\u5C31\u597D\u3002</p><p>\u529E\u516C\u73AF\u5883\u53EF\u4EE5\u5206\u4E3A\u4E24\u4E2A\u73AF\u5883\uFF0C\u5206\u522B\u662F\u201C\u804C\u80FD\u90E8\u95E8\u201D\u548C\u201C\u7814\u53D1\u90E8\u95E8\u201D\uFF1A</p><pre><code>* \u804C\u80FD\u90E8\u95E8\u6BD4\u8F83\u6B63\u5F0F\uFF0C\u5DE5\u4F4D\u3001\u88C5\u4FEE\u4EE5\u53CA\u5458\u5DE5\u7740\u88C5\u90FD\u6BD4\u8F83\u6B63\u89C4\u3002
* \u7814\u53D1\u90E8\u95E8\u8F83\u4E3A\u968F\u610F\u4E00\u4E9B\uFF0C\u65E0\u8BBA\u662F\u5DE5\u4F4D\u8FD8\u662F\u684C\u6905\u4EC0\u4E48\u7684\uFF0C\u6709\u4E9B\u4E1C\u62FC\u897F\u51D1\u7684\u611F\u89C9\uFF0C\u4F46\u662F\u6574\u4F53\u8FD8\u662F\u53EF\u4EE5\u63A5\u53D7\u3002
</code></pre><p>\u53E6\u5916\u53EF\u80FD\u662F\u56E0\u4E3A\u56FD\u4F01\u7684\u539F\u56E0\uFF0C\u6240\u6709\u7684\u5DE5\u4F4D\u90FD\u662F\u5927\u9694\u65AD\u90A3\u79CD\uFF0C\u5982\u679C\u6362\u6210\u73B0\u5728\u516C\u53F8\u5E38\u89C1\u7684\u5927\u901A\u684C\uFF0C\u4F30\u8BA1\u4EBA\u6570\u8FD8\u80FD\u591A\u5750\u5341\u597D\u51E0\u4E2A\uFF0C\u6BD5\u7ADF\u6211\u521A\u6765\u7684\u65F6\u5019\u8FD8\u6CA1\u6709\u6B63\u5F0F\u5DE5\u4F4D\u5750\u5462\u3002</p><h3 id="\u5403" tabindex="-1"><a class="header-anchor" href="#\u5403" aria-hidden="true">#</a> \u5403</h3><p>\u76F8\u6BD4\u4E8E\u5728\u5176\u4ED6\u516C\u53F8\u4E0A\u73ED\uFF0C\u53EF\u80FD\u5728\u8FD9\u6700\u5927\u7684\u4F53\u4F1A\u5C31\u662F\u4E0D\u7528\u8003\u8651\u5403\u4EC0\u4E48\u3002\u516C\u53F8\u6709\u98DF\u5802\uFF0C\u63D0\u4F9B\u5348\u996D\uFF0C\u83DC\u4E0D\u80FD\u9009\uFF0C\u4F46\u662F\u6BCF\u5929\u56DB\u83DC\u4E00\u6C64\uFF0C\u52A0\u6C34\u679C\u6216\u9178\u5976\u3002\u76F8\u6BD4\u4E8E\u6BCF\u5929\u7EA0\u7ED3\u7684\u9009\u62E9\u5916\u5356\uFF0C\u6211\u5BF9\u8FD9\u4E2A\u5F88\u6EE1\u610F\u3002</p><p>\u665A\u4E0A\u5982\u679C\u52A0\u73ED\u7684\u8BDD\uFF0C\u516C\u53F8\u4F1A\u7EDF\u4E00\u8BA2\u9910\uFF0C\u5927\u6982\u4E00\u9910\u7684\u8D39\u7528\u4E5F\u572820\u81F330\u5757\u4E4B\u95F4\u5427\uFF0C\u5F53\u7136\u4E5F\u6CA1\u6CD5\u9009\u62E9\u5403\u4EC0\u4E48\uFF0C\u6709\u5565\u5403\u5565\u5457\u3002</p><p>\u65E9\u9910\u4E3A\u4EC0\u4E48\u6700\u540E\u8BF4\uFF0C\u56E0\u4E3A\u516C\u53F8\u7684\u65E9\u9910\u5728\u65E9\u4E0A\u516B\u70B9\u4E4B\u524D\u4F9B\u5E94\uFF0C\u516B\u70B9\u534A\u4E0A\u73ED\u3002\u3002\u3002\u6709\u70B9\u96BE\u53D7\u554A\u3002</p><p>\u5E78\u597D\u516C\u53F8\u63D0\u4F9B\u7B80\u5355\u7684\u96F6\u98DF\uFF0C\u9762\u5305\u3001\u706B\u817F\u80A0\u3001\u6CE1\u9762\u7B49\u7B49\uFF0C\u867D\u7136\u5076\u5C14\u4F1A\u88AB\u5927\u5BB6\u62A2\u7A7A\uFF0C\u4F46\u662F\u603B\u6BD4\u6CA1\u6709\u5F3A\u5427\u3002</p><h3 id="\u884C" tabindex="-1"><a class="header-anchor" href="#\u884C" aria-hidden="true">#</a> \u884C</h3><p>\u4E0A\u5BB6\u516C\u53F8\u79BB\u6211\u5BB6\u53EA\u67091\u516C\u91CC\u7684\u8DDD\u79BB\uFF0C\u6240\u4EE5\u4ECE\u56DE\u5230\u54C8\u5C14\u6EE8\u4E5F\u6CA1\u6709\u4E70\u8F66\uFF0C\u6BCF\u5929\u6B65\u884C\u4E0A\u73ED\uFF0C\u8FD8\u633A\u60EC\u610F\u7684\u3002</p><p>\u73B0\u5728\u4E0D\u884C\u4E86\uFF0C\u65B0\u516C\u53F8\u8DDD\u79BB\u5BB6\u91CC\u6709\u5341\u597D\u51E0\u516C\u91CC\uFF0C\u5F53\u7136\u6211\u4E5F\u6682\u65F6\u6CA1\u6709\u9009\u62E9\u4E70\u8F66\uFF0C\u5730\u94C1\u51FA\u884C\uFF0C\u5FEB\u6377\u65B9\u4FBF\uFF0C\u8FD8\u7701\u5FC3\uFF0C\u552F\u4E00\u7684\u7F3A\u70B9\u5C31\u662F\u8981\u8D70\u4E2A1.5\u516C\u91CC\u5427\u3002</p><p>\u5728\u665A\u4E0A\u516B\u70B9\u4E4B\u540E\u6253\u8F66\u53EF\u4EE5\u62A5\u9500\u7684\uFF0C\u4F46\u662F\u53EA\u80FD\u662F\u7F51\u7EA6\u8F66\uFF0C\u53EF\u80FD\u51FA\u79DF\u8F66\u7684\u7968\u7C98\u8D34\u592A\u8FC7\u9EBB\u70E6\u4E86\u5427\u3002\u53CD\u6B63\u6211\u662F\u4E0D\u6253\u8F66\uFF0C\u56E0\u4E3A\u6211\u5ACC\u62A5\u9500\u9EBB\u70E6\u3002</p><h3 id="\u5DE5\u5177" tabindex="-1"><a class="header-anchor" href="#\u5DE5\u5177" aria-hidden="true">#</a> \u5DE5\u5177</h3><p>\u5565\u662F\u5DE5\u5177\u5462\uFF0C\u5BF9\u7A0B\u5E8F\u5458\u6765\u8BF4\u5C31\u662F\u7535\u8111\u4E86\uFF0C\u516C\u53F8\u63D0\u4F9B\u7535\u8111\uFF0C\u4F46\u662F\u6027\u80FD\u5C31\u4E00\u822C\u3002\u53EF\u4EE5\u81EA\u5DF1\u53BB\u8D2D\u4E70\uFF0C\u63D0\u4F9B\u53D1\u7968\u5230\u516C\u53F8\uFF0C\u7136\u540E\u6309\u6708\u8FD4\u94B1\u3002\u4F46\u662F\u7535\u8111\u4EF7\u683C\u6863\u4F4D\u8981\u8FBE\u523010000\u4EE5\u4E0A\uFF0C\u6211\u662F\u76F4\u547C\u597D\u5BB6\u4F19\u3002\u6211\u7684\u7535\u8111\u624D5700\u5757\u4E70\u7684\u554A\uFF0C\u8FD9\u662F\u62A5\u4E0D\u4E86\u3002\u4E0D\u8FC7\u4E5F\u65E0\u6240\u8C13\u4E86\uFF0C\u6BD5\u7ADF\u6211\u7528\u4E0D\u4E60\u60EF\u82F9\u679C\uFF01\uFF08\u5176\u5B9E\u6211\u8FD8\u6CA1\u7528\u8FC7\uFF09</p><p>\u516C\u53F8\u7684\u4F1A\u8BAE\u5BA4\u8BBE\u65BD\u8FD8\u662F\u4E0D\u9519\u7684\uFF0C\u5404\u79CD\u6295\u5C4F\u7B49\u7B49\uFF0C\u6BD4\u8F83\u5148\u8FDB\uFF0C\u5B8C\u5168\u6452\u5F03\u4E86\u4F20\u7EDF\u7684\u6295\u5F71\u4EEA\u7B49\u7B49\uFF0C\u8FD9\u8FD8\u8BA9\u6211\u5BF9\u516C\u53F8\u6709\u79CD\u53E6\u773C\u76F8\u770B\u7684\u611F\u89C9\u3002</p><p>\u8FD8\u63D0\u4F9B\u663E\u793A\u5668\u4EC0\u4E48\u7684\uFF0C\u81EA\u5DF1\u7533\u8BF7\u5C31\u597D\u4E86\u3002</p><h2 id="\u5165\u804C\u611F\u53D7" tabindex="-1"><a class="header-anchor" href="#\u5165\u804C\u611F\u53D7" aria-hidden="true">#</a> \u5165\u804C\u611F\u53D7</h2><p>\u6211\u9762\u8BD5\u7684\u5C97\u4F4D\u662Fjava\u5F00\u53D1\uFF0C\u5E38\u89C4\u7684java\u6846\u67B6\u4F7F\u7528\u8D77\u6765\u90FD\u6CA1\u6709\u95EE\u9898\u3002\u9762\u8BD5\u8FC7\u7A0B\u8FD8\u662F\u6BD4\u8F83\u7B80\u5355\u7684\uFF0C\u4E3B\u8981\u662F\u5E38\u7528\u7684\u4E00\u4E9B\u7EC4\u4EF6\uFF0C\u7B80\u5355\u7684\u5B9E\u73B0\u539F\u7406\u7B49\u7B49\uFF0C\u6240\u4EE5\u987A\u5229\u901A\u8FC7\u4E86\u3002</p><p>\u4F46\u662F\u6BD4\u8F83\u9057\u61BE\u7684\u516C\u53F8\u7ED9\u6211\u780D\u4E86\u4E00\u4E9B\uFF0C\u4F46\u662F\u6BD4\u539F\u672C\u63D0\u9AD8\u4E86\u5927\u698220%\u5427\uFF0C\u5B9A\u4F4D\u7684\u804C\u7EA7\u4E5F\u4E0D\u662F\u5F88\u9AD8\u3002\u8BF4\u5B9E\u8BDD\u6211\u8FD8\u662F\u6709\u70B9\u96BE\u53D7\u7684\uFF0C\u6BD5\u7ADF\u6574\u4E2A\u9762\u8BD5\u8FC7\u7A0B\u633A nice \u7684\uFF0C\u6211\u5BF9\u4E2A\u4EBA\u80FD\u529B\u7684\u8BA4\u77E5\u8FD8\u662F\u6BD4\u8F83\u6E05\u695A\u7684\u3002</p><p>\u4F46\u662F\u5F53\u6211\u5165\u804C\u540E\u5C31\u660E\u767D\u4E86\uFF0C\u8FD9\u91CC\u6BD5\u7ADF\u662F\u54C8\u5C14\u6EE8\uFF0C\u6536\u5165\u548C\u5E74\u9F84\u8FD8\u662F\u6709\u5F88\u5927\u7684\u5173\u7CFB\u7684\u3002\u90E8\u95E8\u5185\u6709\u597D\u51E0\u4E2A\u5927\u54E5\uFF0C\u5E74\u9F84\u90FD\u662F35+\u4E86\uFF0C\u4ED6\u4EEC\u4E5F\u53EA\u6BD4\u6211\u9AD8\u4E86\u4E00\u4E2A\u7EA7\u522B\uFF0C\u60F3\u60F3\u4E5F\u5C31\u91CA\u7136\u4E86\uFF0C\u5728\u5176\u4F4D\u8C0B\u5176\u653F\u5427\uFF0C\u4ED6\u4EEC\u7684\u5DE5\u4F5C\u786E\u5B9E\u6BD4\u6211\u8981\u505A\u7684\u7E41\u7410\u3002\u5E0C\u671B\u65E5\u540E\u80FD\u591F\u6162\u6162\u7684\u5347\u804C\u52A0\u85AA\u5427\u3002</p><p>\u603B\u4F53\u6765\u8BF4\uFF0C<strong>\u4E1C\u5317\u4EBA\u8FD8\u662F\u655E\u4EAE</strong>\uFF0C\u6709\u4E8B\u76F4\u63A5\u63D0\uFF0C\u5DE5\u4F5C\u4E5F\u6CA1\u5565\u62D0\u5F2F\u62B9\u89D2\u7684\uFF0C\u5E72\u5C31\u5B8C\u4E86\u3002\u6211\u624D\u521A\u6765\u516C\u53F8\u7B2C\u4E00\u5929\uFF0C\u5C31\u7ED9\u6211\u628A\u5DE5\u4F5C\u5B89\u6392\u4E0A\u4E86\uFF0C<strong>\u4E00\u70B9\u4E0D\u62FF\u6211\u5F53\u5916\u4EBA\u554A</strong>\u3002</p><h2 id="\u5DE5\u4F5C\u611F\u53D7" tabindex="-1"><a class="header-anchor" href="#\u5DE5\u4F5C\u611F\u53D7" aria-hidden="true">#</a> \u5DE5\u4F5C\u611F\u53D7</h2><p>\u65E2\u7136\u8C08\u5230\u5DE5\u4F5C\u4E86\uFF0C\u5C31\u5C55\u5F00\u8BF4\u8BF4\u3002</p><p>\u6211\u7B2C\u4E00\u5929\u5230\u516C\u53F8\uFF0C\u627E\u4E86\u4E2A\u4E34\u65F6\u5DE5\u4F4D\uFF0C\u9886\u5BFC\u4EEC\u5404\u79CDgit\u8D26\u53F7\u3001\u7985\u9053\u8D26\u53F7\u5C31\u7ED9\u6211\u521B\u5EFA\u597D\uFF0C\u4E00\u4E2A\u9879\u76EE\u6254\u7ED9\u6211\uFF0C\u672C\u6708\u4E2D\u671F\u8981\u6C42\u505A\u5B8C\u3002\u3002\u6211\u5F53\u65F6\u5185\u5FC3\u7684\u60F3\u6CD5\u771F\u7684\u662F\uFF1A<strong>\u4E1C\u5317\u4EBA\u679C\u7136\u662F\u597D\u76F8\u5904\u554A\uFF0C\u6574\u7684\u8DDF\u8001\u540C\u4E8B\u4F3C\u7684</strong>\u3002\u6211\u80FD\u600E\u4E48\u529E\uFF0C\u5E72\u5C31\u5B8C\u4E86\u554A\u3002</p><p>\u9879\u76EE\u8FD8\u662F\u5F88\u7B80\u5355\u7684\uFF0C\u5E38\u89C4\u7684springboot + mybatis + vue2\u7684\u5C0F\u9879\u76EE\uFF0C\u5927\u6982\u4E5F\u6CA1\u5230\u6708\u4E2D\u671F\uFF0C\u4E00\u4E2A\u793C\u62DC\u5C31\u5B8C\u4E8B\u4E86\u3002</p><p>\u6BD4\u8F83\u8BA9\u6211\u60CA\u559C\u7684\u662F\u90E8\u7F72\u7684\u73AF\u8282\u3002\u5C45\u7136\u4F7F\u7528\u7684\u662Fdevops\u5DE5\u5177<strong>KubeSphere</strong>\u3002\u6211\u53EA\u8BF4\u8FD9\u4E00\u53E5\u4F60\u4EEC\u53EF\u80FD\u4E0D\u7406\u89E3\uFF0C\u8FD9\u662F\u6211\u5728\u54C8\u5C14\u6EE8\u7684\u7B2C\u4E09\u5BB6\u516C\u53F8\uFF0C\u4ECE\u6765\u6CA1\u6709\u4E00\u5BB6\u516C\u53F8\u8BF4\u4F7F\u7528\u8FC7k8s\uFF0C\u751A\u81F3\u76F8\u5173\u7684devops\u5DE5\u5177\u3002\u53EA\u80FD\u8BF4\u662F\u54C8\u5C14\u6EE8\u8F6F\u4EF6\u884C\u4E1A\u7684\u4E91\u5316\u7A0B\u5EA6\u8FD8\u662F\u592A\u4F4E\u4E86\u3002\u552F\u4E00\u5728\u4E0A\u5BB6\u516C\u53F8\u7684<strong>jenkins</strong>\u8FD8\u662F\u56E0\u4E3A\u6211\u60F3\u5077\u61D2\u642D\u5EFA\u7684\u3002</p><p>\u4E0D\u8FC7\u8FD0\u7EF4\u76F8\u5173\u7684\u5185\u5BB9\u90FD\u628A\u63E1\u5728\u8FD0\u7EF4\u4EBA\u5458\u624B\u91CC\uFF0C\u6240\u4EE5\u60F3\u8981\u638C\u63E1\u5148\u5173\u7684\u77E5\u8BC6\u8FD8\u662F\u8981\u81EA\u5DF1\u79C1\u4E0B\u53BB\u5B66\u4E60\u7684\u3002</p><p>\u9879\u76EE\u5176\u5B9E\u90FD\u662F\u5C0F\u9879\u76EE\uFF0C\u4EE5web\u7AEF\u548Capp\u4E3A\u4E3B\uFF0C\u57FA\u672C\u90FD\u662F\u524D\u540E\u7AEF\u5206\u79BB\u7684\u5355\u4F53\u67B6\u6784\u3002\u552F\u4E00\u6211\u63A5\u89E6\u5230\u7684\u5FAE\u670D\u52A1\u67B6\u6784\u5E94\u8BE5\u5C31\u662F\u516C\u53F8\u7684\u4E2D\u53F0\uFF0C\u63D0\u4F9B\u7EDF\u4E00\u7684\u6743\u9650\u914D\u7F6E\u548C\u767B\u5F55\u8BA4\u8BC1\uFF0C\u6574\u4F53\u8FD8\u662F\u5F88\u4E0D\u9519\u7684\u3002</p><p>\u867D\u7136\u516C\u53F8\u7684\u9879\u76EE\u5F88\u591A\uFF0C\u5DE5\u4F5C\u770B\u8D77\u6765\u5F88\u5FD9\u788C\uFF0C\u4F46\u5B9E\u9645\u8FD8\u662F\u6BD4\u8F83\u8F7B\u677E\u6109\u5FEB\u7684\uFF0C\u6211\u8FD8\u80FD\u5E94\u4ED8\u81EA\u5982\u3002\u6BCF\u5929\u665A\u4E0A\u4E3A\u4E86\u8E6D\u4E00\u987F\u665A\u996D\uFF0C\u901A\u5E38\u4F1A\u52A0\u73ED\u5230\u4E03\u70B9\u534A\u3002\u7528\u665A\u4E0A\u8FD9\u4E2A\u65F6\u95F4\u66F4\u66F4\u6587\uFF0C\u4E5F\u633A\u597D\u7684\u3002</p><p>\u4ECE\u4F53\u6765\u8BF4\uFF0C\u662F\u6211\u6BD4\u8F83\u559C\u6B22\u7684\u5DE5\u4F5C\u8282\u594F\u3002</p><h2 id="\u4E2A\u4EBA\u5206\u6790" tabindex="-1"><a class="header-anchor" href="#\u4E2A\u4EBA\u5206\u6790" aria-hidden="true">#</a> \u4E2A\u4EBA\u5206\u6790</h2><p>\u6211\u662F\u4E00\u4E2A\u4E0D\u592A\u5B89\u5B9A\u7684\u4EBA\uFF0C\u957F\u671F\u5E72\u4E00\u4EF6\u4E8B\u4F1A\u8BA9\u6211\u6BD4\u8F83\u5BB9\u6613\u5931\u53BB\u5174\u8DA3\uFF0C\u8FD8\u662F\u633A\u4EAB\u53D7\u521A\u6362\u5DE5\u4F5C\u65F6\uFF0C\u8FD9\u6BB5\u9002\u5E94\u73AF\u5883\u7684\u611F\u89C9\u3002\u4E5F\u6709\u53EF\u80FD\u66F4\u559C\u6B22\u8FD9\u79CD\u6709\u4E00\u5B9A\u6311\u6218\u7684\u611F\u89C9\u3002</p><p>\u548C\u4E0A\u4E00\u5BB6\u516C\u53F8\u76F8\u6BD4\uFF0C\u8FD9\u5BB6\u516C\u53F8\u5728\u516C\u53F8\u7684\u65F6\u95F4\u660E\u663E\u591A\u51FA\u5F88\u591A\uFF0C\u4E5F\u6CA1\u6709\u90A3\u4E48\u60A0\u95F2\u4E86\uFF0C\u4F46\u662F\u6211\u5374\u89C9\u5F97\u8FD9\u66F4\u9002\u5408\u6211\uFF0C\u6BD5\u7ADF\u6211\u662F\u4E00\u4E2A\u95F2\u4E0D\u4F4F\u7684\u4EBA\uFF0C\u5B89\u9038\u7684\u73AF\u5883\u8BA9\u6211\u611F\u5230\u683C\u5916\u7684\u7126\u8651\uFF0C\u5FD9\u788C\u7684\u751F\u6D3B\u4F1A\u8BA9\u81EA\u5DF1\u611F\u5230\u751F\u6D3B\u5F88\u5145\u5B9E\u3002</p><p>\u8BB0\u5F97\u4E4B\u524D\u7684\u6587\u7AE0\u8BF4\u8FC7\u81EA\u5DF1\u7684\u8EAB\u4F53\u5065\u7684\u4E0D\u592A\u597D\uFF0C\u4F46\u662F\u6700\u8FD1\u56E0\u4E3A\u4E0A\u73ED\u7684\u8DEF\u7A0B\u53D8\u8FDC\uFF0C\u5BFC\u81F4\u8FD0\u52A8\u91CF\u7684\u589E\u52A0\uFF0C\u4E4B\u524D\u4E0D\u9002\u7684\u75C7\u72B6\u4F3C\u4E4E\u90FD\u6D88\u5931\u4E86\u3002\u771F<strong>\u95F2\u51FA\u75C5\u6765\u4E86</strong>\uFF01</p><hr><p>\u65E2\u6765\u4E4B\uFF0C\u5219\u5B89\u4E4B\uFF0C\u65F6\u523B\u63D0\u9192\u81EA\u5DF1\u518D\u52AA\u529B\u70B9\uFF0C\u9633\u5149\u603B\u5728\u98CE\u96E8\u540E\u3002</p>`,41),i={href:"https://juejin.cn/post/7125627005407592462",target:"_blank",rel:"noopener noreferrer"},l=e("hr",null,null,-1);function u(g,_){const r=h("ExternalLinkIcon");return n(),t("div",null,[c,e("blockquote",null,[e("p",null,[a("\u8F6C\u8F7D\u94FE\u63A5\uFF1A"),e("a",i,[a("https://juejin.cn/post/7125627005407592462"),o(r)]),a("\uFF0C\u6574\u7406\uFF1Amusk")])]),l])}const x=p(d,[["render",u],["__file","ruzdbgqzcxyygygsrh.html.vue"]]);export{x as default};
